import React from 'react';

import Search from './Search';

import Me from '../img/me.png'

import './style.css';

export default function Header() {
    return (
        <header>
            <Search/>
            <div className="Amigos" >
                <img src={Me} alt="" />
                <span>Amigos</span>
            </div>
            <hr/>
            <div className="Disponivel" >
                <span>Disponivel</span>
            </div>
            <div className="Options" >
                <span>Todos</span>
            </div>
            <div className="Options" >
                <span>Pendente</span>
            </div>
        </header>
    );
}
